import React, { Component } from "react";

class BookingStructure extends Component {
    constructor(props) {
        super(props);

        this.state = {
            moviedates: undefined,
        }
    }

    componentDidMount() {
        console.log(this.props.moviedates)
        this.setState({ moviedates: Array(this.props.moviedates) });
        console.log(this.state.moviedates);
    }


    render() {
        return (
            <tbody>
                {this.state.moviedates ? this.state.moviedates.map((moviedate) =>
                    <tr>
                        <td>
                            {moviedate}
                        </td>
                    </tr>
                ) :
                    <tr>
                        <td>
                            &nbsp;
                        </td>
                    </tr>}
            </tbody>

        )
    }
}


export default BookingStructure;
